import React, { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import api from "../api";

export default function Editor() {
  const { id } = useParams();
  const navigate = useNavigate();
  const stored = JSON.parse(localStorage.getItem("user") || "null");

  const [docs, setDocs] = useState([]);
  const [title, setTitle] = useState("");
  const [content, setContent] = useState("");

  useEffect(() => {
    if (!stored) return;
    if (id) {
      // Load a specific document
      api.get(`/docs/${id}`).then(res => {
        setTitle(res.data.title || "");
        setContent(res.data.content || "");
      });
    } else {
      // Load all documents
      api.get(`/docs/owner/${stored.id}`).then(res => {
        setDocs(res.data);
      });
    }
  }, [id, stored]);

  // Save new or updated document
  async function saveDoc() {
    if (!title.trim()) {
      alert("Title required");
      return;
    }
    const payload = { title, content, ownerId: stored.id };
    if (id) {
      await api.put(`/docs/${id}`, payload);
    } else {
      const res = await api.post(`/docs`, payload);
      navigate(`/editor/${res.data.id}`);
    }
  }

  // Save a new version
  async function saveVersion() {
    if (!id) return;
    await api.post(`/versions/save`, {
      docId: Number(id),
      content: content
    });
    alert("Version saved!");
  }

  // Delete document (shared for both views)
  async function deleteDoc(docId) {
    if (!window.confirm("Are you sure you want to delete this document?")) return;
    try {
      await api.delete(`/docs/${docId}`);
      if (id) {
        navigate("/editor"); // go back to dashboard after deleting from editor view
      } else {
        setDocs(docs.filter(d => d.id !== docId)); // update list after deleting from dashboard
      }
    } catch (err) {
      alert("Delete failed");
    }
  }

  if (!stored) return <div className="card">Please login first.</div>;

  // =====================
  // Dashboard view (no ID)
  // =====================
  if (!id) {
    return (
      <div className="card" style={{ maxWidth: 800 }}>
        <h2>Your Documents</h2>
        <button onClick={() => navigate("/editor/new")}>New Document</button>
        <ul className="doc-list">
          {docs.length === 0 && <li className="small">No documents yet.</li>}
          {docs.map(d => (
            <li key={d.id} style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
              <div
                style={{ cursor: "pointer" }}
                onClick={() => navigate(`/editor/${d.id}`)}
              >
                <strong>{d.title || "Untitled"}</strong>
                <div className="small">id: {d.id}</div>
                <div className="small">{d.content ? (d.content.slice(0, 40) + "...") : "Empty"}</div>
              </div>
              <button
                className="secondary"
                onClick={(e) => {
                  e.stopPropagation(); // stop click from opening editor
                  deleteDoc(d.id);
                }}
              >
                Delete
              </button>
            </li>
          ))}
        </ul>
      </div>
    );
  }

  // ===================
  // Editor view (with ID)
  // ===================
  return (
    <div className="card" style={{ maxWidth: 800 }}>
      <h2>Document Editor</h2>
      <input
        value={title}
        onChange={(e) => setTitle(e.target.value)}
        placeholder="Document Title"
      />
      <textarea
        style={{ width: "100%", height: 300 }}
        value={content}
        onChange={(e) => setContent(e.target.value)}
      />
      <div style={{ marginTop: 10 }}>
        <button onClick={saveDoc}>Save</button>
        <button className="secondary" onClick={saveVersion}>Save Version</button>
        <button className="secondary" onClick={() => navigate(`/versions/${id}`)}>View Versions</button>
        <button
          style={{ marginLeft: "10px", backgroundColor: "red", color: "white" }}
          onClick={() => deleteDoc(id)}
        >
          Delete Doc
        </button>
      </div>
    </div>
  );
}
